    "nb": "Datasettet viser områder som er under planlegging og sendt på offentlig høring etter lov om Naturmangfold - Kapittel V. Områdevern. \n\nDirektoratet presiserer at det kan forekomme feil og mangler i dette datasettet. Informasjon om verneforslag i Naturbase er kun en tilleggsopplysning. Opplysningene er ikke en formell del av verneplanprosessen, jf. saksbehandlingsreglene etter naturvernloven (rundskriv fra Miljøverndepartementet T-3/99). ). Informasjon om verneforslag i Naturbase er kun en tilleggsopplysning. Dersom det er avgjørende å vite om et konkret areal er foreslått vernet, må det derfor tas kontakt med direktoratet, fylkesmannen i det aktuelle fylke, eller med Sysselmannen på Svalbard."
