  "title": {
    "nb": "Jordkvalitet"
  },
  "description": {
    "nb": "Kartet jordkvalitet viser en vurdering av jordegenskaper som er viktig for den agronomiske bruken av jorda, samt jordbruksarealets hellingsgrad. Jordkvalitetskartet er beregnet uavhengig av klima og forutsetter at jorda er drevet i henhold til god agronomisk praksis. Jordbruksarealene delt inn i tre klasser; svært god, god og mindre god jordkvalitet.\n\nJordkvalitetskartet bygger på data som er fremskaffet gjennom en detaljert feltkartlegging av jordsmonnet basert på internasjonal metodikk og klassifikasjonssystem.\n\nRundt halvparten av Norges fulldyrka og overflatedyrka jord er jordsmonnskartlagt. Hovedvekten av det kartlagte området finnes på Sør-Østlandet, Trøndelag og Jæren. På enkelte steder er også også innmarksbeite kartlagt."
  },
