  "title": {
    "nb": "Valgkretser"
  },
  "description": {
    "nb": "Valgkretsfila viser kommunenes inndeling i stemmekretser i forbindelse med valget. Kommunestyre- og fylkestingsvalget 2019 skal gjennomføres basert på kommuneinndelingen som trer i kraft fra 1.1.2020. Valgkretsfila vil derfor inneholde store endringer fra forrige versjon. Hver stemmekrets vil ha egenskaper som viser kommunenummer i 2020. Fila vil være tilgjengelig som landsdekkende fil. \n\nVed opptelling av stemmer kan kommunen velge å slå sammen flere mindre stemmekretser til en felles tellekrets. Tellekretser er lagt inn i denne fila, som er endelig valgkretsfil, versjon fra 2. august."
  },
