  "title": {
    "nb": "Merverdiavgiftsregisteret"
  },
  "description": {
    "nb": "Opplysninger om næringsdrivende som selger merverdiavgiftspliktige varer eller tjenester ihht merverdiavgiftsloven. \n\nMerverdiavgiftsregisteret inneholder bl.a. informasjon om identifikasjon med org.nr, navn på rolleinnehavere og adresser, status i registeret (aktiv eller slettet), eventuelle fellesregistreringer, næringskoder, tidspunkt for registrering og eventuelle endringer. Inneholder også registreringsgrunn, bl.a. ordinær næringsvirksomhet, kompensasjon til kommuner og fylkeskommuner."
