  "descriptionFormatted": {
    "nb": "Årlige opplysninger fra drosjesentraler om drosjeløyvene som er tilknyttet sentralen. Opplysningene er i all hovedsak de samme som i \"skiftlappen\".\n"
  },
  "objective": {
    "nb": "Drosjesentralene skal årlig levere summerte tall for skiftelappene for drosjeløyvene som er tilknyttet sentralen. Det som skal innrapporteres er kontantomsetning, kredittomsetning, kjørte kilometer og besatte kilometer. Dette tilsvarer de dataene løyvehaver innrapporterer til myndighetene på andre områder. Dermed vil Skatteetaten bedre kunne kontrollere at løyvehaverne og drosjesjåførene følger skatte- og avgiftsreglene."
  },
