  "title": {
    "nb": "Arealressurskart - AR50 - Jordbruk"
  },
  "description": {
    "nb": "Kommunvise kartlag i det landsdekkende datasettet AR50 som viser arealtilstand på jordbruksareal i målestokk 1:50 000 tilpasset bruk i målestokker fra 1:20 000 til 1:100 000. Egenskap som skal brukes til å fremstille kartlaget heter ARJORDBR. AR50 fremstilt ved en generalisering av FKB-AR5 under tregrensa, og tolking av satellittbilder over tregrensa. I tillegg har det vært benyttet N50 der vi verken har hatt AR5 eller satellittbilder. Figurer som er mindre enn 15 dekar, vises ikke på kartet, men blir slått sammen med tilgrensende områder. Areal i kvadratmeter er oppført under egenskap AREA_C. Datasettet oppdateres en gang hvert tredje år med siste års versjon av FKB-AR5 (Arealressurskart i målestokk 1:5000 i databasen pr. 31.12). Siste oppdatering har data fra 31.12.2013. Data lastes ned som fylkesvise eller kommunevise filer."
  },
