  "title": {
    "nb": "Hav og is - bølge- og vindstatistikk for havoverflaten (Hindcast data)"
  },
  "description": {
    "nb": "Klimatologiske kart. Kart som viser midlere signifikant bølgehøyde og midlere vindfart for hver måned og for hele året, og kart som viser prosentvis forekomst av signifikant bølgehøyde over 2, 3, 4, 5, og 6 m og vindfart over 10, 15 og 20m/s. Statistikken bygger på data hver tredje time fra årene 1958 til 2011. Dataene er produsert med numeriske modeller med gridruter på ca 10X10km. Atmosfæredata er nedskalert fra globale data fra det europeiske værvarslingssenteret ved hjelp av atmosfæremodellen HIRLAM, og bølgedataene er beregnet med bølgemodellen WAM med vinddata fra HIRLAM. Sammenligninger viser at modelldataene stemmer godt overens med målte data."
  },
