  "title": {
    "nb": "Altimetri"
  },
  "description": {
    "nb": "Målingene viser hvordan havoverflatas høyde definert over en middelvannsflate varierer i perioden fra 2002 til 2010.\n\nAltimetridataene gir havoverflatas høyde over ellipsoiden og tidsserien viser hvordan denne forandrer seg med tiden. Datasettet kan i prinsippet brukes til å beregne klimatisk havnivåendring langs Norskekysten, men tidsserien som er gjort tilgjengelig er for kort til at et pålitelig estimat kan beregnes. Geodesi har per i dag ikke planer om å gjøre tilgjengelig mer av denne type data, med mindre særskilte behov skulle oppstå.\n\nFilene utgjør en tidsserie av altimetrimålinger (http://en.wikipedia.org/wiki/Radar_altimeter) utført av satellitten ENVISAT (http://en.wikipedia.org/wiki/Envisat). Hver fil inneholder data fra en satellittsykel, det vil si den perioden satellitten trenger for å gjøre en komplett kartlegging av jorda (35 dager)."
  },
  "descriptionFormatted": {
    "nb": "Målingene viser hvordan havoverflatas høyde definert over en middelvannsflate varierer i perioden fra 2002 til 2010.\n\nAltimetridataene gir havoverflatas høyde over ellipsoiden og tidsserien viser hvordan denne forandrer seg med tiden. Datasettet kan i prinsippet brukes til å beregne klimatisk havnivåendring langs Norskekysten, men tidsserien som er gjort tilgjengelig er for kort til at et pålitelig estimat kan beregnes. Geodesi har per i dag ikke planer om å gjøre tilgjengelig mer av denne type data, med mindre særskilte behov skulle oppstå.\n\nFilene utgjør en tidsserie av altimetrimålinger (http://en.wikipedia.org/wiki/Radar_altimeter) utført av satellitten ENVISAT (http://en.wikipedia.org/wiki/Envisat). Hver fil inneholder data fra en satellittsykel, det vil si den perioden satellitten trenger for å gjøre en komplett kartlegging av jorda (35 dager)."
