  "description": {
    "nb": "N50 Raster har lik presentasjon (symbolikk) som kartserien Norge 1:50 000. N50 Raster er begrenset av riksgrensen mot nabolandene og territorialgrensen i havet. Datasettet inneholder sjøinformasjon.\n\nN50 Raster baserer seg på N50 Kartdata og distribueres ukentlig.\n\nN50 Raster på GeoTIFF-format leveres i ruter á 20 km x 20 km. \nFølgende referansefil medfølger GeoTIFF-formatet: SOSI og TFW.\n\nØnskes N50 Raster som fylkesvise filer må dette lastes ned som MrSID-format. Disse filene kan lastes ned fra www.geonorge.no under oppføringen N50 Raster - Fylkesvis"
