  "title": {
    "nb": "Reindrift - Årstidsbeite - Vårbeite"
  },
  "description": {
    "nb": "Den sesongmessige arealbruken er delt inn i fem årstider, som igjen er delt inn i to kategorier etter funksjon og beiteintensitet. Vårbeite er områder som reinen bruker på våren. Vårbeite er delt inn i to kategorier: Vårbeite 1 - Kalvingsland og tidlig vårland. De deler av vårområdet som beites tidligs og hvor hoveddelen av simleflokken oppholder seg i kalvings- og pregningsperioden. Reservekalvingsland inkludert. Vårbeite 2 - Oksebeiteland og øvrig vårland, der okserein og fjorårskalver oppholder seg i kalvingstida. Hit kan også kalver med simler trekke senere på våren.Beitebruken vil variere fra år til år innen samme område. Inndelingssystemet gjelder reindrifta i hele landet. De årlige variasjonene i bl.a. vær og beiteforhold gjør at årstidsavgrensningene må bli noe vide og omtrentlige."
  },
