  "title": {
    "nb": "Konsesjonsområder for uttak av skjellsand, sand og grus fra sjøområdet"
  },
  "description": {
    "nb": "Fylkeskommunen er delegert konsesjonsmyndighet for søknad om utforsking og utnyttelse av skjellsand, sand og grus fra sjøområdet. Skjellsandkonsesjoner har varighet på inntil 5 år, men kan søkes forlenget med inntil 5 år av gangen. Fylkeskommunene har data over både aktive og utgåtte konsesjoner. Konsesjonsdata gir informasjon om varighet på konsesjon og maksimalt tillatt uttak. Konsesjonsgiving styres av lov om undersjøiske naturforekomster (Kontinentalsokkelloven) og tilhørende retningslinjer. Skjellsandkonsesjonsområder er viktig arealinformasjon i forbindelse med kystsoneplaner og kommuneplaner."
  },
