  "title": {
    "nb": "Jordsmonn - Organisk materiale"
  },
  "description": {
    "nb": "Temakart basert på datasettet Jordsmonn som viser innholdet av organisk materiale i plogsjiktet. Innhold av organisk materiale er en indikator på hvor motstandsdyktig jorda er for degradering og\nerosjon. Innhold av organisk materiale kan også ha betydning for valg av vekster på et areal. Arealfigurer etter jordtype. Rundt halvparten av Norges fulldyrka og overflatedyrka jord er jordsmonnskartlagt, med hovedvekt på Sør-Østlandet, Trøndelag og Jæren. På enkelte steder er også også innmarksbeite kartlagt. Kartlaget er fremstilt i målestokk 1:1:5000 og er tilpasset bruk i målestokker fra 1:5000 til 1:20 000. Egenskap som skal brukes til å fremstille kartlaget heter ORGANISK. Geografisk objekt er jordtype."
  },
