  "title": {
    "nb": "Værdata",
    "en": "Road weather data"
  },
  "description": {
    "nb": "Publikasjonen består av meteorologiske måleverdier fra værstasjoner som står langs riks- og fylkesvegnettet. Alle værstasjonene har tilknyttet webkamera som viser jevnlig oppdatert stillbilde, eventuelt video.\r\nPublikasjonen for værdata oppdateres hvert 10 minutt.\r\n\r\nMan må bestille tilgang til statens vegvesen sin DATEX node før man kan kople seg på publikasjonen.\r\n\r\n",
    "en": "The publication contains meteorological measurements from road weather stations along the national - and county road network. All road weather stations are co-located with CCTV (video or continuously updated images.\r\nThe road weather data publication publish updated information every 10 minutes. \r\n\r\nYou have to request a user account before you connect to the publication\r\n"
  },
