  "description": {
    "nb": "Dasettet viser beleggsprosenten time for time i parkeringsanleggene Siddis,Forum,Jernbanen,Posten,Jorenholmen,St. Olav,Valberget,Kyrre og Parketten. Dataene går fram til 20.11.2018. Resterende data for 2018 vil bli lagt til datasettet i januar 2019. Det må tas forbehold om feil, da tellingen ofte må justeres manuelt av vektere. Det hender også at det er feil med tellesløyfer, som har resultert i at p-hus har stått med teksten «Open» i perioder. Vi regner med at dette da bare kommer som 0.0 på listen."
