  "description": {
    "nb": "Kartverkets visningstjenester gir gratis tilgang til en rekke datasett med grunnkart og tematiske kart. De er først og fremst beregnet på de som vil utvikle nye applikasjoner og løsninger. Det dreier seg om visning av datasett som spenner fra sjøgrenser, skyggerelieff og dybdekoter til stedsnavn, historiske kart og topografiske kart i forskjellige målestokker (se liste over de forskjellige visningstjenestene nedenfor). Kartverket tilbyr tjenestene på vegne av rettighetshaverne, som er Kartverket selv, Geovekst parter og kommunene Bærum, Drammen, Stavanger, Bergen og Trondheim En visningstjeneste leverer kartbilder over http-protokollen via REST-lignende kall og kan benyttes i ulike applikasjoner. Kartbildene som leveres, er tilpasset den skjermstørrelsen og det utsnittet applikasjonen ber om."
