  },
  "description": {
    "nb": "Nasjonal digital læringsarena (NDLA) er et interfylkeskommunalt samarbeid som tilbyr fritt tilgjengelige åpne digitale læringsressurser for videregående opplæring. Vestland fylkeskommune er juridisk ansvarlige enhet for det interfylkeskommunale samarbeidet, der 10 fylkeskommuner deltar. NDLA sin visjon er å lage gode, åpne digitale læremidler for alle fag i videregående opplæring og støtte opp om elever og lærere i aktivt og deltakende læringsarbeid. Læringsressursene NDLA ble etablert som prosjekt i 2007 og lanserte de første læringsressursene skoleåret 2008 – 2009. Etter det har porteføljen av fag blitt utvidet år for år. Det langsiktige målet er at NDLA skal kunne tilby komplette læremidler i alle fag i videregående opplæring. Pr 1. januar 2020 tilbyr NDLA læringsresurser i 104 ulike eksamensfag. Nettverk for samarbeid og distribusjon Gjennom arbeidet med å utvikle digitale læringsressurser og spre god pedagogisk bruk av dem, har NDLA utviklet et sterkt faglig nettverk for samarbeid og distribusjon mellom fylkeskommunene. Derfor blir NDLA stadig invitert med som samarbeidspart for store og små satsinger innenfor utdanningsområdet nasjonalt og internasjonalt. Et eksempel på dette er Global digital library ( https://digitallibrary.io/ ). Gjenbruk og lisenser Alle elementer er merket med lisensinformasjon. Som hovedregel vil tekst og interaktive oppgaver være merket med lisenser som tillater kommersiell gjenbruk. Interaktive oppgaver med tekst og bilder har lisensinformasjon innebygd (Rights of use) - bilder tillater sjelden kommersiel gjenbruk, noen er merket med copyright - spillefilmer har copyright - filmklipp kan ha ulike lisenser Tilgang Alt innhold er tilgjengelig på https://ndla.no , i tillegg kan en bruke https://api.ndla.no for å få tilgang til data og dokumentasjon."
  },
