  "description": {
    "nb": "Kolumbus har ansvaret for mobilitet i Rogaland. Sammen med sykkel, gange og tog er vi en sentral brikke for å gjøre innbyggere og besøkende i dagens og fremtidens Rogaland mobile. Kolumbus er et aksjeselskap heleid av Rogaland Fylkeskommune. Vi jobber med å planlegge, administrere, markedsføre og informere om rutetilbudet, samt utvikle nye produkter som skal gjøre det attraktivt å reise kollektivt. Kolumbus har tilgjengeliggjort rutedata siden mars 2011. Fra 2018 finner du våre datasett på Enturs rutedataportal."
  },
