    "nb": "Datasettet er et uttrekk som består av informasjon om storfeindivider registrert hos Mattilsynet per angitt dato. Data i Husdyrregisteret gjenspeiler hva som til enhver tid er rapportert inn. Det kan være avvik mellom hva som framkommer i Mattilsynets Husdyrregister og hva som faktisk er reelt tilfelle ved direkte observasjon. Avvik kan skyldes alt fra feilregistreringer, via forsinkelser, til mangelfull rapportering. Mattilsynet kan ikke garantere for at alle aktører oppfyller sin rapporteringsplikt. Mattilsynet kan heller ikke gå god for at alle data er korrekt fylt ut av de som har rapportert. Se her for nærmere beskrivelse av hva som skal rapporteres og hvem som er underlagt rapporteringsplikt: http://www.mattilsynet.no/dyr_og_dyrehold/produksjonsdyr/merking_og_registrering_av_produksjonsdyr/rapportering_til_husdyrregisteret__storfe.4942 Hjemmel for rapporteringen: https://lovdata.no/dokument/SF/forskrift/2010-07-09-1131 Forklaring til de enkelte feltene Opprinnelsesmerke: For norskfødte individer er dette en kombinasjon av de åtte første sifrene fra produsentnummer (se produsentnr) fra der dyret er født og et firesifret individnummer. Storfe fra andre land enn Norge kan ha opprinnelsesmerke bygget opp på annen måte. Opprinnelsesland: Navn på individets opprinnelsesland Individmerke: Dette en kombinasjon av de åtte første sifrene fra produsentnummer (se dette) fra der dyret er født og et firesifret individnummer. Hvis individet er født i Norge er individmerket identisk med opprinnelsesmerke. Individstatus: Eksempler på status er «Komplett», «Dyr overført. Mangler rapport fra kjøper», «Dyr overført. Mangler rapport fra selger.», «Dyr slaktet. Mangler rapport fra slakteri.», «Dyr rapportert overført fra livdyrhandler/slaktet. Mangler rapport fra kjøper og selger.», «Dyr slaktet. Mangler rapport fra dyrehold.» Individer har en status som er avhengig av de hendelser som er blitt rapportert. Mange hendelser er enkelthendelser, det betyr at de blir rapportert av kun én part ved hjelp av én hendelse. Et eksempel på dette er \u0027Nyfødt dyr merket første gang\u0027. Disse hendelsene har status komplett og medfører enten at et dyr blir opprettet med status komplett eller om dyret allerede finnes så blir ikke dyrets status påvirket. Hendelser som innebærer forflytning krever to, tre eller eventuelt fire hendelser. Dette er fordi alle berørte parter skal rapportere både når et dyr kommer inn i dyreholdet og når det går ut av dyreholdet. Dette gjelder forflytning mellom dyrehold, med eller uten livdyrhandlere, og overføring til slakteri og slakting. Alle hendelser som gjelder overføring mellom dyrehold eller slakting krever at status på dyret er komplett innen første hendelse i forflytningen kan bli registrert. Et individs status kan være representativt kun i det øyeblikket data har blitt hentet ut fra Husdyrregisteret. At et individ framstår som «Komplett» eller med «Manglende rapporter» kan medføre riktighet i det øyeblikket data ble trukket ut, men kanskje ikke umiddelbart etterpå. Født: Individets fødselsdato på formatet dd.mm.åååå Kjønn: Individets kjønn er enten «Kvige/ku» for hunkjønn eller «Okse» for hankjønn Rasekode: Består av teksten LANDDYR$ + en tallkode For forklaring på tallkoden se http://www.mattilsynet.no/integrasjonsstotte/KODEVERK_RASETYPE_no.html Rase: Rase er betegnelsen på rasekode – i klartekst. Rasebetegnelse: Her kan det framkomme rasen til henholdsvis far (de 16 første sifrene) og mor (de 16 siste sifrene). Det er to og to siffer i par som utgjør koden. For oversikt over de to-sifrete kodene se her: http://www.mattilsynet.no/integrasjonsstotte/KODEVERK_RASETYPE_I_textcode_no.html Morsmerke: Hvis individets mor er født i Norge er morsmerket bygget opp på samme måte som Individmerket. Produsentnr: Inneholder 10-sifret produsentnummer. Oppbygning av produsentnummer: Kommunenummer 4 siffer + Gårdsnummer 4 siffer + et løpenummer 2 siffer. Foretaksnr: Dette tilsvarer det som i Brønnøysundregisteret omtales som «Organisasjonsnummer». Kalvingsdato: Dette er siste kalvingsdato registrert i Husdyrregisteret på et individ. Kalving som sådan er ikke en meldepliktig hendelse. Det er hendelsen nyfødt kalv merket første gang som er meldepliktig. Informasjon om fødselsdato og mors opprinnelsesmerke er blant de obligatoriske opplysninger om denne hendelsen. Kalvingsdatoen utledes fra disse opplysningene. Kalvingsdato kan mangle eller ikke være oppdatert. Årsak kan være for eksempel: Ei ku kan ha fått en kalv som har dødd før den ble merket. Kalven er ikke meldt inn i husdyrregisteret med hendelsen nyfødt kalv merket første gang ."
  },
