  "title": {
    "nb": "Postjournalstatistikk (OEP) - Innsynskrav 2010"
  },
  "description": {
    "nb": "Offentlig elektronisk postjournal (OEP) ble lansert 18. mai 2010 og er en felles publiseringstjeneste for statlige virksomheters postjournaler. Virksomhetene bruker publiseringsløsningen til å gjøre sine egne postjournaler tilgjengelig på internett for alle brukere. De ulike postjournalene blir deretter samlet i en felles database som blir gjort søkbar for brukerne. Brukerne kan søke etter informasjon gjennom OEP og bestille innsyn i den informasjonen de finner interessant. Denne bestillingen blir sendt til den virksomheten som er ansvarlig for journaloppføringen. Deretter blir bestillingen behandlet av virksomheten som et innsynskrav, og brukeren får svar direkte fra virksomheten. Bruksstatistikk for OEP fra og med lanseringsdato mai 2010 til medio september 2011 er publisert på datahotellet. Dataene viser antall innsynskrav fordelt på statlige virksomhetene hver måned. Datasettet vil oppdateres hver måned framover."
  },
