  "title": {
    "nb": "Yrkesbeskrivelser fra utdanning.no"
  },
  "description": {
    "nb": "Datasettet inneholder tekstlige beskrivelser og klassifisering av over 550 yrker. Yrkene er skrevet av redaksjonen hos utdanning.no og kvalitetssikres jevnlig av over 200 organisasjoner i arbeidslivet. Navngiving Dersom du benytter yrkesbeskrivelsene ber vi om at endringer og tillegg merkes, og at du henviser til kilden på følgende måte: Yrkesbeskrivelsen er basert på åpne data fra utdanning.no og er underlagt Norsk lisens for offentlige data ( NLOD ). Teksten vedlikeholdes på yrkessiden på utdanning.no . Relaterte kodeverk Yrkene er klassifisert etter standard for yrkesklassifisering ( STYRK98 ), norsk standard for utdanningsgruppering ( NUS2000 ) og interesser, samt at de inneholder lenker til intervju av yrkesutøvere. Hvordan benytte datasettet? Datasettet er XML-basert og lister ut alle yrker i Atom-format. Innholdet er søkbart slik at det er mulig å bare hente ut yrker basert på for eksempel STYRK, NUS, interesser, fritekstsøk eller en kombinasjon av disse. Eksempler på bruk følger. Hente ut alle yrker som er klassifisert med NUS-koder som starter med 45 eller 46, Naturvitenskapelige fag, håndverksfag og tekniske fag , videregående avsluttende utdanning eller grunnutdanning: - https://utdanning.no/data/atom/yrke?fq\u003dsm_field_nus_field_nus_code:(45 OR 35) Hente ut alle yrker som er merket med interessen helse: - https://utdanning.no/data/atom/yrke?fq\u003dsm_field_interesse_label:helse Hente ut alle yrker som er merket med yrkesklassifiseringskode 7134116, Lærling (rørlegger) : - https://utdanning.no/data/atom/yrke?fq\u003dsm_field_styrk98_field_code_styrk:7134116 Fritekstsøk i yrkesbasen: - https://utdanning.no/data/atom/yrke?q\u003drørlegger En kan også kombinere og søke etter flere kriterier på en gang: - https://utdanning.no/data/atom/yrke?q\u003drørlegger\u0026amp;fq\u003dsm_field_styrk98_field_code_styrk:7134116\u0026amp;fq\u003dsm_field_nus_field_nus_code:45 - Fritekstsøk: rørlegger - FIltrere på yrker som er tagget med yrkesklassifisering 