  "description": {
    "nb": "Datasettet er basert på en kvanitativ webbasert spørreundersøkelse sendt til internasjonale studenter ved norske universitet og høyskoler. Målet med undersøkelsen er å gi økt kunnskap om hvordan Norge oppfattes som studie- og forskningsland i utlandet og å kartlegge grunnene til at de internasjonale studentene valgte Norge og den norske utdanningsinstitusjonen de studerer eller forsker ved. Undersøkelsen i 2012 er den tredje omdømmeundersøkelsen SIU har gjennomført. Tidligere omdømmeundersøkelser er gjennomført i 2008 og 2010."
